import './App.css'
import KnowledgeTest from "./KnowledgeTest";

function App() {
    return (

            <div className="app">
                <Navbar />
                <main>
                    {/* Здесь ваше основное содержимое */}
                    <h1>Содержимое вашего приложения</h1>
                    <RegistrationForm /> {/* Добавьте компонент формы в основное содержимое */}
                    <SchoolInfoBox /> {/* Добавьте компонент SchoolInfoBox после RegistrationForm */}
                    <KnowledgeTest/>
                </main>
            </div>
    );
}

export default App;
